description:
Week 20 of TEMPLATE, a new digital comics series from QAM Comics. Fans of Thrillbent, Monkeybrain, or DC Digital First style comics should definitely check it out. 

We would like to bring TEMPLATE to print, and need your help. From now until September 13 we are running a Kickstarter campaign to fund a 1000 copy print run to bring the first story arc to retail stores nationwide. The link to the project page is here:
 &lt;a href=&quot;
http://www.kickstarter.com/projects/qmiles/template-volume-1&quot; rel=&quot;nofollow&quot; target=&quot;_NEW&quot;&gt;
http://www.kickstarter.com/projects/qmiles/template-volume-1&lt;/a&gt;

So score some cool stuff and help us get TEMPLATE into the hands of more people as well. If this works, we can potentially even start work on a Volume 2, so spread the word if you like what we're doing!

Thanks!

Q
